import Assignment6 from "./a6";
import Nav from "../nav";
import Assignment7 from "./a7";
import {Routes, Route} from "react-router";

function Labs() {
   return (
     <div>
       <Nav/>
       <Assignment7/>
       <Routes>
         <Route index
          element={<Assignment6/>}/>
         <Route path="a7"
          element={<Assignment7/>}/>
       </Routes>
     </div>
   );
  }
  
  export default Labs;
